	"luigi/demo/4_collections/environments/environment.controller.js":function(){sap.ui.define(["luigi/demo/common/BaseController","luigi/demo/libs/luigi-client/luigi-client","/sap/ui/model/json/JSONModel"],function(e,t,i){"use strict";return e.extend("qldh.environment.environment",{onInit:function(){this.setModel(new i({code:`\n          const auth = 'Basic ' + btoa(pm.environment.get("Username") + ":" + pm.environment.get("Password"));\n          headers['Authorization'] =  auth;\n          pm.environment.set('auth', auth);`,test:`\n          pm.test("Work item is not Zero", function () {\n            var jsonData = pm.response.json();\n            pm.expect(jsonData.Workitem).not.eql("0000000000000");\n        });\n        `,url:`url: pm.environment.get('URL') +'/sap/opu/odata/sap/ZHR_MV_ALLOW_CLAIM_SRV/hasValidWagetypes?sap-client=' pm.environment.get("SAP-Client") +'&saml2=disabled',\n        `}))},onSelect:function(e){this.byId(e.toString()).setSelected(false)},onValidate:function(){if(this.byId("2").getSelected()===true){this.getView().byId("success").setVisible(true);this.getView().byId("failure").setVisible(false);this._showFireworks();setTimeout(()=>{document.getElementById("myFrame").style.visibility="visible"},200)}else{this.getView().byId("failure").setVisible(true);this.getView().byId("success").setVisible(false)}}})});
},
	"luigi/demo/4_collections/environments/environment.html":'<!DOCTYPE html>\n<html>\n  <head>\n    <meta charset="utf-8" />\n    <meta name="viewport" content="width=device-width, initial-scale=1.0" />\n    <title>Navigation and Routing Tutorial</title>\n    <link rel="stylesheet" href="../../common/style.css">\n\n    <script\n      id="sap-ui-bootstrap"\n      src="https://sapui5.hana.ondemand.com/resources/sap-ui-core.js"\n      data-sap-ui-theme="sap_fiori_3"\n      data-sap-ui-resourceroots=\'{\n\t\t\t"qldh.environment": "./","luigi.demo":"../../"\n\t\t}\'\n      data-sap-ui-oninit="module:qldh/environment/index"\n      data-sap-ui-language="en"\n      data-sap-ui-logLevel="none"\n      data-sap-ui-async="true"\n    ></script>\n  </head>\n  <body class="sapUiBody">\n    <canvas id=\'myCanvas\' width=\'1200\' height=\'800\' style="position: fixed;"></canvas>\n    <div\n      data-sap-ui-component\n      data-name="qldh.environment"\n      data-id="container"\n      data-settings=\'{"id" : "app"}\'\n      id="content"\n    ></div>\n    <iframe id="myFrame" style="visibility: hidden" class="embed" src="https://giphy.com/embed/YQitE4YNQNahy"  width="480" height="319" frameBorder="0" class="giphy-embed" allowFullScreen></iframe>\n  </body>\n</html>\n\n',
	"luigi/demo/4_collections/environments/environment.view.xml":'<mvc:View\n\tcontrollerName="qldh.environment.environment"\n\txmlns="sap.m"\n\txmlns:mvc="sap.ui.core.mvc"\n\txmlns:core="sap.ui.core"\n\n\txmlns:html="sap.ui.core.HTML"\n\txmlns:code="sap.ui.codeeditor"\n\tdisplayBlock="true"><App id="app"><Page class="sapUiMediumMargin"  showHeader="false"><content><Wizard id="CreateProductWizard" class="sapUiResponsivePadding--header sapUiResponsivePadding--content"\n\t\t\t\tcomplete="onValidate" finishButtonText="Validate"><WizardStep id="step1" title="Create an Environment" validated="true"><core:Fragment\n\t\t\t\tfragmentName="qldh.environment.fragments.step1" type="XML" /></WizardStep><WizardStep id="step2" title="Manage users in environment" validated="true"><core:Fragment\n\t\t\t\tfragmentName="qldh.environment.fragments.step2" type="XML" /></WizardStep></Wizard></content></Page></App></mvc:View>\n\n',
	"luigi/demo/4_collections/environments/fragments/step1.fragment.xml":'<core:FragmentDefinition\n\txmlns="sap.m"\n\txmlns:core="sap.ui.core"\n\txmlns:code="sap.ui.codeeditor"\n\t><VBox class="sapUiMediumMargin"><Text text="1. Click the Environment tab and click the + button" class="sapUiTinyMarginBottom" /><Image src="./assets/environment.PNG" class="sapUiTinyMarginBottom"/><Text text="2. Name the environment HED" class="sapUiTinyMarginBottom" /><Text text="3. Add a new variable called URL and set the initial value to \'https://myhr-dev.health.qld.gov.au\'" class="sapUiTinyMarginBottom" /><Text text="4. Add a second variable \'SAP-Client and add the value 120" class="sapUiTinyMarginBottom" /><Image src="./assets/HED.PNG" class="sapUiTinyMarginBottom"/><Text text="5. Click Save" class="sapUiTinyMarginBottom" /><Text text="6. In the Create Claim request we have saved in our collection, replace the hostname of the system with {{URL}} and the client number with {{SAP-Client}} " class="sapUiTinyMarginBottom" /><Image src="./assets/url.PNG" class="sapUiTinyMarginBottom"/><MessageStrip text="Notice that the auto complete will help you with the variables and also show you the content of collection, global and environment variables when you hover over it." class="sapUiTinyMarginBottom" showIcon="true" type="Information" /><Text text="7. Now create another environment in the same fashion for HEG" class="sapUiTinyMarginBottom" /><Text text="8. Click the environment tab and click the ... next to HED and then duplicate" class="sapUiTinyMarginBottom" /><Image src="./assets/Copy.PNG" class="sapUiTinyMarginBottom"/><Text text="9. Remember to change both the initial value and the current value of the URL" class="sapUiTinyMarginBottom" /><Image src="./assets/predev.PNG" class="sapUiTinyMarginBottom"/></VBox></core:FragmentDefinition>',
	"luigi/demo/4_collections/environments/fragments/step2.fragment.xml":'<core:FragmentDefinition\n\txmlns="sap.m"\n\txmlns:code="sap.ui.codeeditor"\n\n\txmlns:core="sap.ui.core"><VBox><MessageStrip text="We do have one issue with environments if we want to have different users for different systems as we can\'t get auth credentials from the environment, let\'s create a workaround" class="sapUiTinyMarginBottom" showIcon="true" type="Information" /><FormattedText htmlText="1. Click the &lt;span style=\'font-size: 24px;\'&gt;&#128065;&lt;/span&gt; icon and select edit" class="sapUiTinyMarginBottom" /><Text text="2. Create two new variables called username and password and set them to 250004 and Myhr1234 respectively" class="sapUiTinyMarginBottom" /><Text text="3. Add one more variable called auth and don\'t set a value , then click update." class="sapUiTinyMarginBottom" /><Text text="4. Click the Pre-request script and replace line 3 with the following" class="sapUiTinyMarginBottom" /><code:CodeEditor editable="false"\n\tvalue="{/code}"\n\theight="400px" /><Image src="./assets/pre.PNG" class="sapUiTinyMarginBottom"/><Text text="5. Also change line 8 and replace it with the line below" /><code:CodeEditor editable="false"\n        value="{/url}"\n        height="400px" /><MessageStrip text="Now our prerequest script will use the same environment variables for the fetching of the csrf-token" class="sapUiTinyMarginBottom" showIcon="true" type="Information" /><Text text="6. Click the Authorization tab and set the type to No Auth" class="sapUiTinyMarginBottom" /><Text text="7. Go to the Headers tab and add a header named \'Authorization\' and set the value to {{auth}}" class="sapUiTinyMarginBottom" /><Image src="./assets/auth.PNG" class="sapUiTinyMarginBottom"/><MessageStrip text="Now we use the username and password from the environment as an authentication instead of from the collection. This header would need to be maintained on all subsequent requests as well in the collection" class="sapUiTinyMarginBottom" showIcon="true" type="Information" /><Text text="8. Add the same variables to the environment for HEG" class="sapUiTinyMarginBottom" /><Text text="9. Select the HEG environment and execute your request" class="sapUiTinyMarginBottom" /><Text text="Did it work?" class="sapUiTinyMarginBottom" /><CheckBox id="1" text="No" select=".onSelect(\'2\')" /><CheckBox id="2" text="Yes" select=".onSelect(\'1\')" /><MessageStrip text="Success, you are well on your way to become a true postman hacker!" showIcon="true" type="Success" visible="false" id="success" class="msgStrip" /><MessageStrip text="Failure, try again" showIcon="true" type="Error" visible="false" id="failure" class="msgStrip" /></VBox></core:FragmentDefinition>',
